class Solution {
private:
    void createInterval(unordered_map<int, pair<int, int>>& m, const int num) {
        m[num] = pair<int, int>(num, num);
    }

    void mergeIntervals(unordered_map<int, pair<int, int>>& m, const int num) {
        mergeIntervals(m, num-1, num);
        mergeIntervals(m, num, num+1);
    }

    void mergeIntervals(unordered_map<int, pair<int, int>>& m, const int num1, const int num2) {
        if (m.find(num1) == m.end() || m.find(num2) == m.end()) {
            return;
        }

        pair<int, int> p1 = m[num1];
        pair<int, int> p2 = m[num2];

        m.erase(p1.second);
        m.erase(p2.second);

        pair<int, int> p(p1.first, p2.second);
        m[p.first] = p;
        m[p.second] = p;
    }

public:
    int longestConsecutive(vector<int>& v_nums) {
        unordered_set<int> nums(v_nums.begin(), v_nums.end());

        unordered_map<int, pair<int, int>> intervals;
        for (const int num : nums) {
            createInterval(intervals, num);
            mergeIntervals(intervals, num);
        }

        int ans = 0;
        for (const auto [_, interval] : intervals) {
            ans = max(ans, interval.second - interval.first + 1);
        }

        return ans;
    }
};

